        {
            if (m_Wrapper.m_PlayerItemsActionsCallbackInterfaces.Remove(instance))
                UnregisterCallbacks(instance);
        }

        public void SetCallbacks(IPlayerItemsActions instance)
        {
            foreach (var item in m_Wrapper.m_PlayerItemsActionsCallbackInterfaces)
                UnregisterCallbacks(item);
            m_Wrapper.m_PlayerItemsActionsCallbackInterfaces.Clear();
            AddCallbacks(instance);
        }
    }
